import "./App.css";

function App() {
  async function getJoke() {
    const res = await fetch("https://v2.jokeapi.dev/joke/Programming?amount=1");
    const prom = await res.json();
    console.log(prom);
  }
  return (
    <div className="App">
      <button className="get-joke" onClick={getJoke}>
        Get Joke!
      </button>
    </div>
  );
}

export default App;
